    ItemMasterStockComponent.prototype.saveSelectedModel = function (selectedRow, indeex) {
        selectedRow.isBoolean = indeex;
        //Moveing getSelectedItem from here Below Code
        var ischange = false;
        if (this.selectedModels.length > 0) {
            //praveen's code//
            this.selectedModels.map(function (row) {
                if (selectedRow.aircraftModelId == row.aircraftModelId) {
                    ischange = true;
                }
            });
        }
        if (!ischange) {
            this.selectedModels.push(selectedRow);
        }
        console.log(this.selectedModels);
    };
    ItemMasterStockComponent.prototype.getSelectedItem = function (selectedRow, event) {
        //;
        var ischange = false;
        if (this.selectedModels.length > 0) {
            //praveen's code//
            this.selectedModels.map(function (row) {
                if (selectedRow.aircraftModelId == row.aircraftModelId) {
                    row.priority = event.target.value;
                    ischange = true;
                }
            });
        }
        if (!ischange) {
            this.selectedModels.push(selectedRow);
        }
        console.log(this.selectedModels);
    };
